import React, { useEffect } from "react";
import axios from "axios";

const Protected = () => {
  const getProtected = async () => {
    location.reload();
    // try {
    //   await axios.get("/protected");
    // } catch (e) {
    //   console.log(e);
    // }
  };

  useEffect(() => {
    getProtected();
  }, []);
  return <div></div>;
};

export default Protected;
